css:
@-moz-document url-prefix("https://8ch.net/"), url-prefix("https://nerv.8ch.net/") {
/* 
 * 8chan Dark Fagioli with Mascot
 * Version: 0.8
 * By: Desu
 * Mascot: ARX-160 - Girls Frontline
 * Notes: This style will not work properly on boards with a custom theme.
 */

/*body: see bottom of file for background uri, which had to be converted to base64 as a work around to the site's CSP*/
body {
    background: #161616;
    color: #b7b3b3;
    position: relative;
    padding: 0!important;
    margin: 0!important;
}
body, body * {
	font-size: 13px!important;   
}
a, a:visited {
    color: #86e8db!important;
}
a:hover {
    color: #f1f2b5!important;  
}
.intro span.subject, .threadtitle {
	color: #abaadd;  
}
.intro span.name, .intro a.email span.name, .intro span.capcode {
    color: #a5d8ff;
    font-weight: normal;
}
.desktop-style div.boardlist {
	background-color: rgba(0,0,0,.5)!important;
   	border: 0!important;
}
span.detected {
	color: #FAF8F8;
    background: #3060A8;
}
span.heading, .sage, .com {
    color: #ffadd4;
}
pre {
	background: #222;
    border-radius: .2em;
    padding: 1em!important;
}
pre .str {
    color: #b7eaad;
}
pre .kwd {
    color: #a5c6ff;
}
pre .pun {
    color: #b7d870;
}
pre span.pln {
	color: #ccc; 
}
pre .lit {
    color: #45d1a0;
}
pre .typ{
    color: #d7b2ff;
}

/*header*/
div.banner {
	background: rgba(0,0,0,.25); 
    font-weight: normal!important;
}
header h1 {
    font-size: 20px!important;
    font-weight: normal!important;
    color: #b7b3b3!important;
    text-shadow: 0;
    padding-top: 1em;
    background: transparent!important;
    border: 0!important;
}
header div.subtitle, h2, div.blotter, body > p.subtitle {
	color: #b7b3b3!important; 
}
body > p.subtitle {
	font-size: 1.5em!important;   
}

/*move clutter controls off the thread flow to the bottom right of the page*/
body.active-thread > #expand-all-images, 
body.active-thread > div.unimportant, 
body.active-thread > #gallery-view,
body.active-index > #expand-all-images, 
body.active-index > div.unimportant, 
body.active-index > #gallery-view {
    position: fixed;
    bottom: 2em;
    right: 2em;
    color: #555!important;
}
body.active-thread > #expand-all-images a, 
body.active-thread > div.unimportant a, 
body.active-thread > #gallery-view a,
body.active-thread > div.thumbnail a,
body.active-index > #expand-all-images a, 
body.active-index > div.unimportant a, 
body.active-index > #gallery-view a,
body.active-index > div.thumbnail a {
	color: #555!important;   
}
body.active-thread > div.unimportant,
body.active-index > div.unimportant {
 	bottom: 8em;   
}
body.active-thread > #expand-all-images, 
body.active-index > #expand-all-images {
    bottom: 6em;
}
body.active-thread > #gallery-view,
body.active-index > #gallery-view {
 	bottom: 4em;   
}

/*add some space between the head and the actual content*/
body.active-thread form[name="postcontrols"],
body.active-index form[name="postcontrols"] {
	margin-top: 2em!important; 
}
/*push everything to the left*/
body.active-thread > header,
body.active-index > header, 
body.active-thread > .banner,
body.active-index > .banner,
body.active-thread > div.blotter,
body.active-index > div.blotter,
body.active-index > div.thumbnail,
body.active-thread > div.thumbnail,
body.active-thread form[name="postcontrols"], 
body.active-index form[name="postcontrols"] {
   margin-right: 50%!important;
   margin-left: 10px!important;
}

/*other pages*/
div.pages {
	background: #222;
    border-color: #333;
}
div.module, div.ban {
	background: #222;
    border-color: #333;
}
div.ban h2 {
	background: #111;   
}
form table tr th {
    background: #111;
    border: 1px solid #000;
}
form table#banlist tr td:hover {
    background: #333!important;
}
p[style="color:red"], li.newsplus::after {
    color: #fcbded!important;
}

/*site homepage*/
.box {
	background: rgba(0,0,0,.3);
    color: rgba(255,255,255,.5);
    border: 0;
}
.box-title {
	background: rgba(0,0,0,.5);
    color: rgba(255,255,255,.5);
}
.col {
	background: transparent!important;   
}
table tbody tr:nth-of-type(2n),
table.board-list-table tr:nth-of-type(2n) .board-tags .board-cell {
	background: transparent;   
}

/*remove clutter*/
hr,
img.board_image,
a#bottom,
footer,
div.boardlist.bottom,
div#new-bottom-ads,
.announcement {
	display: none;   
}

/*post form*/
div#post-form-outer {
	position: fixed;
    top: 3em;
    right: 2em;
    background: #222!important;
    border: 1px solid #111!important;
    padding: 5px;
    border-radius: .5em;
    z-index: 5;
    box-shadow: 0 1px 2px #111;
}
div#post-form-inner form[name="post"] {
    background: transparent!important;
    border: none!important;
}
table.post-table {
	border: none!important;
}
form[name="post"] table.post-table tr th, table.post-table-options tr th {
	background-color: #111!important;   
}
textarea, input[type="text"], input[type="submit"], form[name="post"] input[type="button"], button, select {
	background: rgba(255,255,255,.1);
    border: 1px solid rgba(0,0,0,.9);
    font-size: 13px!important;  
    color: #9C9C9C;
}
textarea, input[type="text"] {
	width: 150px!important;   
}
table.post-table textarea#body {
	width: 250px!important;   
}
table.post-table select {
	width: 150px!important;   
}

/*catalog*/
div.mix div.thread {
    background-color: transparent;
    cursor: pointer;
}
.theme-catalog div.thread {
	font-size: 13px!important;  
}

/*thread*/
body.active-index div.thread {
    overflow: auto;
    margin-bottom: .5em;
}
div.post_modified {
	margin-left :0;
    color: #333;
}
span.omitted {
	color: #333;   
}
div.thread p.quote {
    color: #8bc183;
}
div.thread {
	overflow: auto;   
}
div.thread > br {
   display: none!important;
}
body.active-index div.thread {
    margin-bottom: 1em;
}
div.post {
    display: block!important;
}
div.post img.post-image {
	padding: 0;
    margin: 5px 10px 10px 0!important;
    width: 200px!important;
    height: auto!important;
}
.file {
	margin: 0!important;   
}
p.fileinfo, p.fileinfo a {
	margin: 0!important;
    color: #555!important;
}
p.fileinfo {
	padding-left: 0!important;   
}
div.post div.body {
	margin: 0!important;   
}
div.post.op {
	margin: 0 0 10px 5px;  
}
div.post.reply {
    overflow: auto;
    width: auto!important;
    max-width: inherit!important;
    background: #222!important;
    border: 1px solid #333;
    padding: 5px 10px!important;
    margin: 0 0 5px 0!important;
}
div.post.reply.highlighted {
	background: #333!important;   
}
div.post > div.post-hover {
   border: 1px solid #555!important;
   background: #444;
   width: 600px!important;
   box-shadow: 2px 2px 2px rgba(0,0,0,.5)!important;
}

body > div.pages {
	background: transparent;
    border: 0!important;
}

/*alert*/
#alert_div {
    background: #333;
}

/*options popup*/
#options_div {
	background: #333;
    border: 1px solid #444;
    box-shadow: 3px 3px 3px rgba(0,0,0,.5)!important;
}
.options_tab_icon.active {
	color: #fff;
}
.options_tab_icon {
	color: #999;
}
#options_div #favs-add-board #plus, #options_div #minusList div {
	color: #e0e0e0!important;
}

/* board specific: /prog/ */
body[data-stylesheet="board/prog.css"] header {
	background-color: rgba(204,255,204,.1)!important;
}
body[data-stylesheet="board/prog.css"] form[name="postcontrols"] {
	background-color: transparent!important;
    border: none!important;
}
body[data-stylesheet="board/prog.css"] div.thread {
	border: none!Important;   
}
body[data-stylesheet="board/prog.css"]  table.post-table tr {
    display: block!important;
}

/* base64 uri for the background. You can convert your own mascot at base64-image.de */
body.active-index, body.active-thread {
	background: #141414  url('data:image/png;base64,') 72% top fixed no-repeat!important;   
}
}
